import "./Supermarket.css";

const Supermarket = () => {
  return (
    <div className="backgroundSuper">
      <div className="bannerSuper" id="landing">
        Supermarket
      </div>
      <div className="superContainer">
        <p className="linkExplain">
          There are 3 supermarket near the structure <br /> you can find links below to get driving directions <br />
          Simply click on the link you prefer and open your favourite map app
        </p>
          <div className="superLinks">
            <div className="superInfo">
              <a href="http://maps.apple.com/?q=37.08825761369096,15.159846916778568" rel="noreferrer" target="_blank"> COOP Supermarket </a>
              <p>2 minute | 750 m | €€€</p>
            </div>
            <a href="http://maps.apple.com/?q=37.08044982434281,15.162501512776997" rel="noreferrer" target="_blank"> EuroSpin Supermarket </a>
            <a href="http://maps.apple.com/?q=37.08005594977314,15.164382697630419" rel="noreferrer" target="_blank"> Penny Supermarket </a>
          </div>
      </div>
    </div>
  );
};

export default Supermarket;
